import "./styles/App.scss";
import UIButton from "./components/layout/button/button";
import { ChevronLeft } from "@material-ui/icons";
import React from "react";

function App() {
  return (
    <>
      <UIButton
        type="button"
        buttonStyle="btn-primary-solid"
        buttonSize="btn-normal"
      >
        +Add Feedback
      </UIButton>
      <UIButton
        variant="contained"
        startIcon={React.cloneElement(<ChevronLeft />)}
        type="button"
        buttonStyle="btn-icon-solid"
        buttonSize="btn-normal"
      >
        Go Back
      </UIButton>
    </>
  );
}

export default App;
